import React from "react";

import Tile from "../tile/Tile.js";

export const TileList = ({ tiles }) => {



  return (
    <div>
      {tiles.map(({ name, ...description}, index) => {
        <Tile 
          key={index} 
          name={name} 
          description={description} 
          /> 
      })}
    </div>
  );
};
